"Request timeout" H12 Heroku error tying to access MongoDB Atlas<p>This problem seems to be quite common but I've tried several things and I still get this error.</p>

<p>Alright, so I'm trying to deploy on app on Heroku with my DB on MongoDB Atlas but when I'm trying a register or login POST request I get this message in the Heroku logs :</p>

<pre><code>2020-03-29T09:54:50.197717+00:00 heroku[router]: at=error code=H12 desc="Request timeout" method=POST path="/users/register" host=sleepy-beach-03876.herokuapp.com request_id=87810d90-3e72-4ff7-929e-77157f1b4a12 fwd="xxx.xxx.xxx.xxx" dyno=web.1 connect=0ms service=30001ms status=503 bytes=0 protocol=https
</code></pre>

<p><strong>What i've tried</strong> :</p>

<ul>
 <li>Increasing connection timeout time</li>
 <li>Double check if my IP address is Whitelisted, it is</li>
 <li>Double check if the URI is correct, it seems correct</li>
 <li>Using Heroku Config vars</li>
</ul>

<p>Here's the URI<br>
<code>mongoURI : 'mongodb+srv://xxx:xxxxxxxx@clusterftr-wrdqy.mongodb.net/test?retryWrites=true&amp;w=majority'</code></p>

<p>I've tried this</p>

<pre><code>mongoose.connect(db.mongoURI, {
    useNewUrlParser: true,
    useUnifiedTopology: true,
})
.then(() =&gt; console.log(`MongoDB connected... ${db.mongoURI}`))
.catch(err =&gt; console.log(err + db.mongoURI));
</code></pre>

<p>And this</p>

<pre><code>const MongoClient = require('mongodb').MongoClient;
const uri = "mongodb+srv://xxx:xxxxxxxx@clusterftr-wrdqy.mongodb.net/test?retryWrites=true&amp;w=majority";
const client = new MongoClient(uri, { useNewUrlParser: true });
client.connect(err =&gt; {
  const collection = client.db("test").collection("users");
  client.close();
});
</code></pre>

<p><br>
<em>Please note that it's my first StackOverflow post and one of my first Node projects, so please be understanding and send me some feedbacks if you want to :)</em></p>

