How can I get autoincrement Predictable ID with C# and MongoDb<p>I'm using MongoDb with a .Net Core 3 solution and here is my problem.<br>
I chosed MongoDb for various reasons and I want as much as possible to stick with it.
I want to be able to insert an object into the db and retrieve it with an id that I can guess programmatically.
My object would be something like:</p>

<pre><code>public class myclass
{
    public int Id {get; set;}

    public string SomeValue {get; set;} 
}
</code></pre>

<p>But doing it that way will just insert the default value of <code>int</code> and that's it. I don't know the id beforehand that's why I want autoincrement basically.
I also tried to us the format:      </p>

<pre><code>public class myclass
{
    [BsonId]
    public ObjectId Id {get; set;}

    public string SomeValue {get; set;} 
}
</code></pre>

<p>And even though it does autoincrement, it does it the mongo way.<br>
<code>ObjectId("5e68f3b3407d9b261b5312fc")</code> that is not very predictable in that way.<br>
which from <a href="https://api.mongodb.com/csharp/1.6/html/dd6074e6-ef82-d1d9-7731-d59972ec3e65.htm" rel="nofollow noreferrer">Here</a> Contains this:
<a href="https://i.stack.imgur.com/6Psch.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/6Psch.png" alt="objectid properties"></a><br>
And that's quite handy so I tried to use <code>Increment</code> but can't manage to get it to work when I retrieve it.</p>

<pre><code>var doc = await _collection.FindAsync(x =&gt; x.ID.Increment == myId).ConfigureAwait(false);
</code></pre>

<p>or something like this:    </p>

<pre><code>var doc = await _collection.FindAsync(new FilterDefinitionBuilder&lt;Question&gt;().Gt(x =&gt; x.ID.Increment, myId)).ConfigureAwait(false);
</code></pre>

<p>this way worked with the <code>int</code> ID like if I try to get the <code>ID == 0</code>    </p>

<p>Question is is there a better or proper way to have autoincrement <code>int</code> or whatever predictable value with C# and mongoDb ?</p>

