Why does MongoDB require `unique:true` to create a collection?<p>I am developing a NodeJS application with Express and MongoDB. My objects were not getting saved to the database, so I dug deeper and I found that the target collection was not created if I used:</p>

<pre class="lang-js prettyprint-override"><code>const PersonSchema = new Schema({
  firstName: String,
});
</code></pre>

<p>and the collection was created if I used</p>

<pre class="lang-js prettyprint-override"><code>const PersonSchema = new Schema({
  firstName: { type: String, unique: true},
});
</code></pre>

<p>In either case, the full model in <code>server/models/person.js</code> is:</p>

<pre class="lang-js prettyprint-override"><code>'use strict';

const mongoose = require('mongoose');
const Schema = mongoose.Schema;

// Use native promises.
mongoose.Promise = global.Promise;

// Define the Person schema.
const PersonSchema = new Schema({
  // ...
});

const Person = mongoose.model('Person', PersonSchema);

module.exports = Person;
</code></pre>

<p>I have MongoDB 4.2.3 (with <code>db.version()</code> in the mongo shell), npm 6.14.4, mongoose 5.7.5, and npm mongodb 3.3.2 (with <code>npm list | grep mongodb</code>).</p>

<p>Why does MongoDB require a unique field in addition to <code>_id</code> to create a collection?</p>

